import React from "react";

interface IProps {
  children: React.ReactNode;
  display?: "flex";
  justifyContent?: string;
  alignItems?: string;
}

const Main = ({
  children,
  display = "flex",
  justifyContent = "space-between",
  alignItems = "center"
}: IProps) => {
  return <div>MAIN</div>;
};

export default Main;
